import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <div className="hero" id="hero">
      <div className="content">
        <p>Call us</p>
        <p>+85267901714</p>
        <p>Because Money</p>
        <p>Doesn't come with instruction</p>
        <button href="/" className="button">
          Free Consultations
        </button>
      </div>
    </div>
  );
};

export default Hero;
